<?php

namespace Tests\Feature\Plates;

use App\Models\Plate;
use App\Models\Restaurant;
use App\Models\User;
use Database\Seeders\RoleSeeder;
use Database\Seeders\UserSeeder;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Illuminate\Foundation\Testing\WithFaker;
use Tests\TestCase;

class CreatePlateTest extends TestCase
{

    use RefreshDatabase;
    protected Restaurant $restaurant;

    /**
     * A basic feature test example.
     */
    public function test_an_authenticated_user_can_create_a_plate(): void
    {
        // $this->withoutExceptionHandling();
        $data = [
            'name'        => 'Name test',
            'description' => 'Description test',
            'price'       => '$123',
            'image' => 'data:image/jpeg;base64,'
        ];

            $response = $this->apiAs(User::find(1), 'post', "{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);


            $response->assertStatus(200);
            $response->assertJsonStructure([
                'data' => ['plate' => ['id', 'restaurant_id', 'name', 'description', 'price', 'image']],
                'message', 'status', 'errors'
            ]);
            $plate = Plate::find(1);
            $response->assertJsonFragment([
                'data' => [
                    'plate' => [
                        ...$data,
                        'id' => 1,
                        'restaurant_id' => $this->restaurant->id,
                        'links' => ['parent' => route('restaurants.show', $this->restaurant)],
                        'image' => $plate->image,
                    ]
                ]
            ]);
            $this->assertDatabaseHas('plates', [
                'name'=> 'Name test',
                'description' => 'Description test',
                'price' => '$123',
            ]);
            $this->assertDatabaseMissing('plates', [
                'image' => 'data:image/jpeg;base64,',
            ]);

            $this->assertNotNull($plate->image);
    }

    public function test_a_unauthenticated_user_cannot_update_a_plate(): void
    {
        $data = [
            'name'=> 'Name test',
            'description' => 'Description test',
            'price' => '$123'
        ];

            $response = $this->postJson("{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);


            $response->assertStatus(401);
    }

    public function test_a_unauthenticated_user_can_only_update_their_plates(): void
    {
        $data = [
            'name'=> 'Name test',
            'description' => 'Description test',
            'price' => '$123'
        ];

        $user = User::factory()->create();
            $response = $this->apiAs($user, 'post',"{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);


            $response->assertStatus(403);
    }

    public function test_plate_name_is_required()
    {
        $data = [
            'name'=> '',
            'description' => 'Description test',
            'price' => '$123'
        ];

        $response = $this->apiAs(User::find(1), 'post', "{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);

        $response->assertStatus(422);
        $response->assertJsonStructure(['errors' => ['name']]);
    }

    public function test_plate_description_is_required()
    {
        $data = [
            'name'=> 'Name test',
            'description' => '',
            'price' => '$123'
        ];

        $response = $this->apiAs(User::find(1), 'post', "{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);

        $response->assertStatus(422);
        $response->assertJsonStructure(['errors' => ['description']]);
    }



    public function test_plate_price_is_required()
    {
        $data = [
            'name'=> 'Name test',
            'description' => 'Description test',
            'price' => ''
        ];

        $response = $this->apiAs(User::find(1), 'post', "{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);

        $response->assertStatus(422);
        $response->assertJsonStructure(['errors' => ['price']]);
    }

    public function test_plate_image_is_required()
    {
        $data = [
            'name'=> 'Name test',
            'description' => 'Description test',
            'price' => '123',
            'image' => '123'
        ];

        $response = $this->apiAs(User::find(1), 'post', "{$this->apiBase}/restaurants/{$this->restaurant->id}/plates", $data);

        $response->assertStatus(422);
        $response->assertJsonStructure(['errors' => ['image']]);
    }

    protected function setUp(): void
    {
        parent::setUp();
        $this->seed(RoleSeeder::class);
        $this->seed(UserSeeder::class);
        $this->restaurant = Restaurant::factory()->create([
            'user_id' => 1
        ]);
    }
}
